import './App.css';
import {useState} from "react";

function App(){

    const [counter, setCounter] = useState(0)

    const increment = () => {
        setCounter(counter + 1)
    }
    const decrement = () => {
        setCounter(counter - 1)
    }

    return(
            <div>
        <h1>{counter}</h1>
                <button onClick={increment}>add</button>
                <button onClick={decrement}>remove</button>
            </div>
        )


}

export default App;
